class LFUCache {
    constructor(capacity) {
        this.capacity = capacity;
        this.keyNode = {};
        this.countNode = {};
        this.minCount = 0;
    }

    get(key) {
        if (!this.keyNode.hasOwnProperty(key)) {
            return -1;
        }

        const node = this.keyNode[key];
        const count = node.count;

        this.countNode[count].remove(node);

        if (this.countNode[count].size === 0) {
            delete this.countNode[count];
            if (count === this.minCount) {
                this.minCount++;
            }
        }

        node.count++;
        this.countNode[node.count] = this.countNode[node.count] || new DoublyLinkedList();
        this.countNode[node.count].add(node);

        return node.value;
    }

    put(key, value) {
        if (this.capacity === 0) {
            return;
        }

        if (this.keyNode.hasOwnProperty(key)) {
            const node = this.keyNode[key];
            node.value = value;
            this.get(key);
            return;
        }

        if (Object.keys(this.countNode).length === this.capacity) {
            const minCount = this.minCount;
            const leastFreqNode = this.countNode[minCount].removeTail();
            delete this.keyNode[leastFreqNode.key];
            delete this.countNode[minCount];
        }

        const newNode = new Node(key, value);
        this.keyNode[key] = newNode;
        this.countNode[1] = this.countNode[1] || new DoublyLinkedList();
        this.countNode[1].add(newNode);
        this.minCount = 1;
    }
}

