var maxCoins = function(nums) {
    let n = nums.length;
    let dp = Array(n+2).fill(0).map(() => Array(n+2).fill(0));
    nums.unshift(1);
    nums.push(1);
    for (let i = 2; i < n+2; i++) {
        for (let j = i-2; j >= 0; j--) {
            for (let k = i; k < n+2; k++) {
                if (nums[j] < nums[i] && nums[i] < nums[k]) {
                    dp[j][k] = Math.max(dp[j][k], dp[j][i-1] + dp[i+1][k] + nums[j] * nums[i] * nums[k]);
                }
            }
        }
    }
    return dp[1][n+1];
};

