 *
 * @param {TreeNode} root
 * @return {string}
 */
var serialize = function(root) {
    if (!root) return 'X';
    return Number(root.val) + ',' + serialize(root.left) + ',' + serialize(root.right);
};

/**
 * Decodes your encoded data to tree.
 *
 * @param {string} data
 * @return {TreeNode}
 */
var deserialize = function(data) {
    let nodes = data.split(',');
    function helper() {
        let node = nodes.shift();
        if (node === 'X') return null;
        let curr = new TreeNode(node);
        curr.left = helper();
        curr.right = helper();
        return curr;
    }
    return helper();
};

