const MOD = 10**9 + 7;

/**
 * @param {number} n
 * @param {number[]} rollMax
 * @return {number}
 */
var dieSimulator = function(n, rollMax) {
    let dp = Array(n + 1).fill(0).map(() => Array(7).fill(0));
    dp[0][0] = 1;
    for (let i = 1; i <= n; i++) {
        for (let j = 1; j <= 6; j++) {
            if (i <= rollMax[j - 1]) {
                dp[i][j] = (dp[i - 1][0] + dp[i - 1][j]) % MOD;
            } else {
                dp[i][j] = (dp[i - 1][0] + dp[i - 1][j] - dp[i - rollMax[j - 1] - 1][j]) % MOD;
                if (dp[i][j] < 0) dp[i][j] += MOD;
            }
        }
    }

    let res = 0;
    for (let j = 1; j <= 6; j++) {
        if (n <= rollMax[j - 1]) {
            res = (res + dp[n][j]) % MOD;
        } else {
            let limit = rollMax[j - 1];
            let excess = n - limit;
            res = (res + dp[limit][j] * dp[excess][0]) % MOD;
        }
    }

    return res;
};

/**
 * @param {number} n
 * @param {number[][]} edges
 * @return {number[]}
 */
var countSubgraphsForEachDiameter = function(n, edges) {
    let graph = Array(n).fill(0).map(() => new Set());
    for (let [u, v] of edges) {
        graph[u-1].add(v-1);
        graph[v-1].add(u-1);
    }
    let res = Array(n-1).fill(0);
    for (let i = 0; i < n; i++) {
        let depths = Array(n).fill(0);
        dfs(i, graph, depths);
        for (let j = 1; j < n; j++) {
            if (depths[j] > 0) {
                res[j-1] += helper(depths, j);
            }
        }
    }
    return res;
};

function dfs(node, graph, depths) {
    for (let next of graph[node]) {
        if (depths[next] === 0) {
            depths[next] = depths[node] + 1;
            dfs(next, graph, depths);
        }
    }
}

function helper(depths, maxDepth) {
    let count = 0;
    for (let i = 0; i < depths.length; i++) {
        if (depths[i] > 0 && depths[i] <= maxDepth) {
            count++;
        }
    }
    return count;
}

