/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function(s, t) {
    const tCount = {};
    for (let c of t) {
        tCount[c] = (tCount[c] || 0) + 1;
    }
    let left = 0, minLen = Infinity, minStart = 0, formed = 0;
    const windowCounts = {};
    for (let right = 0; right < s.length; right++) {
        const rightChar = s[right];
        windowCounts[rightChar] = (windowCounts[rightChar] || 0) + 1;
        if (tCount[rightChar] && windowCounts[rightChar] === tCount[rightChar]) formed++;
        while (left <= right && formed === Object.keys(tCount).length) {
            const leftChar = s[left];
            if (right - left + 1 < minLen) {
                minLen = right - left + 1;
                minStart = left;
            }
            windowCounts[leftChar]--;
            if (tCount[leftChar] && windowCounts[leftChar] < tCount[leftChar]) formed--;
            left++;
        }
    }
    return minLen === Infinity ? "" : s.substring(minStart, minStart + minLen);
};

var solveNQueens = function(n) {
    const result = [];
    const cols = new Set();
    const posDiag = new Set();
    const negDiag = new Set();

    function solve(row, solution) {
        if (row === n) {
            result.push(solution);
            return;
        }
        for (let col = 0; col < n; col++) {
            if (cols.has(col) || posDiag.has(row + col) || negDiag.has(row - col)) {
                continue;
            }
            cols.add(col);
            posDiag.add(row + col);
            negDiag.add(row - col);
            solve(row + 1, solution.concat([`.${Array(n).fill('.').map((_, i) => i === col ? 'Q' : '.').join('')}`]));
            cols.delete(col);
            posDiag.delete(row + col);
            negDiag.delete(row - col);
        }
    }
    solve(0, []);

    result.sort();

    return result;
};

var Heap = require('./heap');

/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var findKthLargest = function(nums, k) {
    const heap = new Heap((a, b) => a < b);
    for (const num of nums) {
        heap.push(num);
    }

    for (let i = 0; i < k - 1; i++) {
        heap.pop();
    }

    return heap.peek();
};

