var topKFrequent = function(nums, k) {
    const count = {};
    nums.forEach(num => {
        count[num] = (count[num] || 0) + 1;
    });
    const sorted = Object.entries(count).sort((a, b) => b[1] - a[1]);
    return sorted.slice(0, k).map(([num]) => parseInt(num));
};

